import "../styles/home.css";
import Hat from "../elements/Hat.js"
import "../styles/Hat.css";
import { Link } from 'react-router-dom';

const Create = () => {
    return (
        <div>
            <Hat/>
            <div id="HomePage"> 
                <div id="homeNavigation">
                    <ul>
                        <li>
                            <Link to="/home"></Link>
                        </li>
                        <li>
                            <Link to="/home/create"></Link>
                        </li>
                    </ul>
                </div>
                <div id="queueList">
                    <div className="queue">
                        Очередь
                    </div>
                </div>
            </div>

        </div>
    );
};

export default Create;
